Information
------------------------------

Skywire Walk Live with Nik Wallenda
In one of the most daring and captivating live events in television history, Nik Wallenda will tightrope walk, unharnassed, across the majestic Grand Canyon in Arizona. Standing 1,500 feet above the Little Colorado River, the tightrope walking legend will balance a distance of 1,500 feet on wire only two-inches in diameter. The tightrope walk will challenge Wallenda to walk higher than he ever has before, as well as honouring his Great-Grandfather, the legendary Karl Wallenda, who died after falling from his tightrope in Puerto Rico in 1978.

